import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import React from 'react';
import './App.css';
import NavBar from './components/navBar';
import Home from './views';

function App() {
  console.log("Refreshing...");
  return (
    <Router>
      <NavBar />
      <Switch>
        <Route path='/' exact component={Home} />
      </Switch>
    </Router>
  );
}

export default App;
